pragma solidity ^0.8.0;

// Importing Ownable contract from OpenZeppelin, which allows access control to certain functions for the contract owner
import "@openzeppelin/contracts/access/Ownable.sol";

// Defining the main contract
contract MyContract is Ownable {

    // Defining a struct for the Content type, which includes ID, price, and the creator's address
    struct Content {
        string id;
        uint price;
        address payable creator;
    }

    // Defining a struct for the Membership type, similar to Content
    struct Membership {
        string id;
        uint price;
        address payable creator;
    }

    // Creating mappings to keep track of all contents and memberships, linking string IDs to their respective structs
    mapping(string => Content) public contents;
    mapping(string => Membership) public memberships;

    // Setting a processing fee percentage (in basis points, so 250 represents 2.5%)
    uint constant PROCESSING_FEE_PERCENT = 250; 

    // Events that will be emitted when a content or membership is purchased
    event PurchaseContent(string contentId, address buyer);
    event PurchaseMembership(string membershipId, address buyer);

    // Function to create a new content entry. This can be called by anyone.
    function createContent(string memory _id, uint _price) public {
        contents[_id] = Content(_id, _price, payable(msg.sender));
    }

    // Similar to createContent, but for memberships
    function createMembership(string memory _id, uint _price) public {
        memberships[_id] = Membership(_id, _price, payable(msg.sender));
    }

    // Function to allow a user to purchase a content. This requires the sender to send enough ether to cover the price.
    function purchaseContent(string memory _id) public payable {
        Content memory content = contents[_id];
        require(msg.value >= content.price, "Not enough Ether provided.");

        // Calculate the processing fee and the amount that goes to the creator
        uint fee = (msg.value * PROCESSING_FEE_PERCENT) / 10000;
        uint amountToCreator = msg.value - fee;

        // Transfer the payment to the creator
        content.creator.transfer(amountToCreator);

        // Emit the PurchaseContent event
        emit PurchaseContent(_id, msg.sender);
    }

    // Similar to purchaseContent, but for memberships
    function purchaseMembership(string memory _id) public payable {
        Membership memory membership = memberships[_id];
        require(msg.value >= membership.price, "Not enough Ether provided.");

        // Calculate the processing fee and the amount that goes to the creator
        uint fee = (msg.value * PROCESSING_FEE_PERCENT) / 10000;
        uint amountToCreator = msg.value - fee;

        // Transfer the payment to the creator
        membership.creator.transfer(amountToCreator);

        // Emit the PurchaseMembership event
        emit PurchaseMembership(_id, msg.sender);
    }
}
